import React, { Component } from 'react';
import item_list from './item_list';

function Market_view() {
    return (
        <div>
            <item_list name="컴퓨터" cost = "100만원"/>
            <item_list name="커피머신" cost = "20만원"/>
        </div>
        
    );
}

export default Market_view;
